import { BlurView } from "expo-blur";
import React, { useMemo, useState } from "react";
import {
  Pressable,
  StyleProp,
  StyleSheet,
  View,
  ViewStyle,
} from "react-native";
import FastImage, { ImageStyle, Source } from "react-native-fast-image";
import { SafeAreaView } from "react-native-safe-area-context";
import { SIZE_REF_8 } from "../../utility/constants";

export interface ProfileIconProps {
  style?: StyleProp<ViewStyle>;
  size: number;
  onPress: () => void;
}

const ProfileIcon = ({ style, size, onPress }: ProfileIconProps) => {
  const imageSource: Source = useMemo(
    () => ({
      uri: "data:image/jpeg;base64,",
    }),
    []
  );

  const imageContainerDynamicStyle: StyleProp<ViewStyle> = useMemo(
    () => ({
      width: size,
      height: size,
      borderRadius: size * 0.5,
    }),
    [size]
  );

  const imageDynamicStyle: StyleProp<ImageStyle> = useMemo(
    () => ({
      width: size,
      height: size,
      borderRadius: size * 0.5,
    }),
    [size]
  );

  return (
    <Pressable onPress={onPress}>
      <View style={[imageContainerDynamicStyle, style]}>
        <FastImage
          source={imageSource}
          resizeMode="cover"
          style={[imageDynamicStyle]}
          fallback={true}
        />
      </View>
    </Pressable>
  );
};

const styles = StyleSheet.create({
  container: {
    width: SIZE_REF_8 * 6,
    height: SIZE_REF_8 * 6,
    borderRadius: SIZE_REF_8 * 3,
    flexWrap: "nowrap",
    alignItems: "center",
    justifyContent: "center",
  },
  image: {
    width: SIZE_REF_8 * 6,
    height: SIZE_REF_8 * 6,
    borderRadius: SIZE_REF_8 * 3,
  },
});

export default ProfileIcon;
